import React from 'react'

export default function Option({ label, value, labelText }) {
    return (

        <div>

            <label for={label}>
                {`${labelText}`}
            </label>
            <select id={label}>
                <option value={value}>
                    {`${value}`}
                </option>
            </select>

        </div>
    )
}
